  TEAM 7 as part of project S-N909-NRT3-10 in the Coastal Waters of SE Alaska on 2010-07-19
  (NCEI Accession 0130678)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\":
